import Overview from "./Overview";
import Repositories from "./Repositories";
import Projects from "./Projects";

const Navbar = () => {
    return (

        
            <nav className="flex justify-center px-2 max-md:justify-between ml-4">
                <Overview />
                <Repositories />
                <Projects />
            </nav>
        

    )
}
export default Navbar;
